INSERT INTO `language_fields` VALUES (1532, '理才网在线用户服务协议与用户资料保密承诺', 'Licai Network Online User Service Agreement and User Data Privacy Promise', 'page_title', 41, '0,1968', '2020-08-12 17:28:30', '2020-08-05 11:37:46', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (1533, '本协议由您与深圳市理才网信息技术有限公司共同缔结，本协议具有合同效力。', 'This Agreement is entered into between you and Shenzhen Licai Network Information Technology Co., Ltd.', 'page_description', 41, '0,1968', '2020-08-12 17:29:17', '2020-08-05 11:38:07', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (1534, '一、服务条款的确认和接纳', 'First:recognition and acceptance of terms of service', 'section_1_title', 41, '0,1968', '2020-08-10 13:47:09', '2020-08-05 11:38:37', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (1535, '理才网（<a href=\"http://www.daydao.com\" target=\"_blank\">http://www.daydao.com</a>）英文表示“daydao”是由深圳市理才网信息技术有限公司（以下称“理才网”或“理才网公司”）开发的一站式企业管理在线服务网站（以下简称“理才网”），“daydao”旗下包括人力资源管理、财务管理、销售管理、协同办公等水平云产品应用及信息、交通、建设、餐饮、医疗等垂直云产品应用。用户在注册程序过程中点击“同意”按钮完成注册，即表示用户与理才网已达成协议，自愿接受本服务条款的所有内容。', 'The Licai Network <ahref=\"http://www.daydao.com\"target=\"_blank\">http://www.daydao.com</a> is owned by Shenzhen Licai Network Information Technology Co., Ltd. (hereinafter referred to as \"Licai Network\"), a one-stop online enterprise management service website (hereinafter referred to as \"Licai Network\") developed by the Company. Under \"daydao\", there are horizontal cloud product applications such as human resources management, financial management, sales management, collaborative office and vertical cloud product applications such as information, transportation, construction, catering, medical and so on. By clicking the \"Agree\" button during the registration process, the user has reached an agreement with Licai Network and voluntarily accepts all the contents of the terms of service.', 'section_1_paragraph_1', 41, '0,1968', '2020-08-12 17:35:18', '2020-08-05 11:39:34', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (1536, '任何修订和新规则一经公布即自动成为本服务条款的一部分，用户登录或继续使用服务的行为将被视为接受上述规则修改并愿意继续履行合同的意思表示。理才网享有理才网旗下网站或应用上一切活动的监督、提示、检查、纠正及处罚等权利。', 'Any amendments and new rules will automatically become part of the terms of service upon their publication. The act of logging in or continuing to use the services will be deemed as acceptance of the above rule amendments and willingness to continue to perform the contract. Licai Network reserves the right to monitor, prompt, check, correct and punish any activity on Licai Network\'s websites or applications.', 'section_1_paragraph_2', 41, '0,1968', '2020-08-12 17:20:44', '2020-08-05 11:40:01', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (1537, '二、服务保护条款', 'Second:terms of service protection', 'section_2_title', 41, '0,1968', '2020-08-10 13:46:54', '2020-08-05 11:40:34', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (1538, '理才网是由理才网公司运用自己的操作系统通过国际互联网络为用户提供各项人力资源管理在线服务，用户必须。', 'Licai Network is an online service for human resources management provided by Licai Network using its own operating system via the Internet.', 'section_2_p1', 41, '0,1968', '2020-08-13 20:36:10', '2020-08-05 11:40:58', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (1539, '自备设备，包括但不限于个人电脑一台、调制解调器一个及配备上网装置。', 'Own equipment, including, but not limited to, a personal computer, a modem and an internet connection.', 'section_2_p2', 41, '0,1968', '2020-08-13 20:36:07', '2020-08-05 11:41:22', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (1540, '用户上网并自行支付与此服务有关的费用。', 'User accesses the internet and pays for the costs associated with this service himself.', 'section_2_p3', 41, '0,1968', '2020-08-13 20:36:05', '2020-08-05 11:41:37', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (1541, '因注册使用的真实性需要，用户同意。', 'By virtue of the authenticity of the registered use, the user agrees to', 'section_2_p4', 41, '0,1968', '2020-08-13 20:36:04', '2020-08-05 11:41:51', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (1542, '提供真实、详尽及准确的注册资料(包括但不限于个人信息、企事业单位信息等)。', 'Provide true, detailed and accurate registration information (including, but not limited to, personal information, information on enterprises and institutions, etc.).', 'section_2_p5', 41, '0,1968', '2020-08-13 20:36:02', '2020-08-05 11:42:06', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (1543, '随时更新注册资料，符合真实、详尽、准确的要求。所有原始键入的资料将引用为注册资料。', 'The registration data is updated at any time to meet the requirements of truthfulness, detail and accuracy. All original keystrokes will be cited as registration data.', 'section_2_p6', 41, '0,1968', '2020-08-13 20:36:00', '2020-08-05 11:42:22', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (1544, '尊重用户隐私是理才网的一项基本政策。未经用户授权或许可，理才网一定不会公开、编辑或透露用户的注册资料包括姓名、住址、电子邮箱、帐号及保存在理才网上的各项服务中的非公开内容，除非理才网在诚信的基础上认为透露这些信息在以下几种情况是必要的。', 'Respecting user privacy is one of our basic policies. We will not disclose, edit, or reveal your registration information, including your name, address, email address, account number, and non-public content stored in our services, without your authorization or permission, unless we believe in good faith that disclosure of such information is necessary in the following situations', 'section_2_p7', 41, '0,1968', '2020-08-13 20:35:58', '2020-08-05 11:42:37', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (1545, '遵守有关法律法规，包括在国家有关机关查询时，提供用户在理才网网页上发布的信息内容及其发布时间、互联网地址或者域名以及其他用户上传至理才网上的信息。', 'Comply with relevant laws and regulations, including providing information on the content of information posted by users on our web pages and the time of its posting, Internet address or domain name, and other information uploaded by users to our web pages, upon inquiry by the relevant national authorities', 'section_2_p8', 41, '0,1968', '2020-08-13 20:35:56', '2020-08-05 11:42:57', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (1546, '法律、法规要求或者按照有关政府主管部门的要求，需要理才网提供用户的注册资料。', 'Required by law or regulation, or by the relevant government authorities, to provide the registration data of the users of Licai Network.', 'section_2_p9', 41, '0,1968', '2020-08-13 20:35:54', '2020-08-05 11:44:23', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (1547, '在紧急情况下维护用户个人和社会大众的隐私安全。', 'Maintaining the privacy and security of individual users and society at large in emergency situations', 'section_2_p10', 41, '0,1968', '2020-08-13 20:35:48', '2020-08-05 11:44:41', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (1548, '为维护公众以及理才网合法利益。', 'In order to protect the legitimate interests of the public as well as those of Licai Network.', 'section_2_p11', 41, '0,1968', '2020-08-13 20:35:45', '2020-08-05 11:45:02', 'userAgreement', '0', NULL, NULL);
