INSERT INTO `language_fields` VALUES (1713, '理才网为用户提供各种与企业管理与经营相关的服务。用户通过在线自助将需要的资料上传到理才网服务器，理才网公司通过对客户上传的资料提供专业的在线人才管理服务。', 'Licai Network provides a variety of services related to business management and operations. The user uploads the required information to the web server through online self-help, and the company provides a professional online talent management service for the uploaded information.', 'section_3_p2', 41, '0,1968', '2020-08-12 17:00:12', '2020-08-06 10:45:07', 'userAgreement', '0', NULL, NULL);
