INSERT INTO `language_fields` VALUES (1717, '理才网为用户提供集成的云平台服务，用户通过daydao云服务平台对人力资源管理、财务管理、销售管理、协同办公等水平云产品应用及信息、交通、建设、餐饮、医疗等垂直云产品应用进行集成和部署。', 'Through the daydao cloud service platform, users can integrate and deploy horizontal cloud applications such as human resource management, financial management, sales management and collaborative office, as well as vertical cloud applications such as information, transportation, construction, catering and medical services.', 'section_3_p4', 41, '0,1968', '2020-08-06 12:00:01', '2020-08-06 10:45:52', 'userAgreement', '0', NULL, NULL);
