INSERT INTO `language_fields` VALUES (1722, '用户在申请使用理才网提供的网络服务时，必须向理才网提供真实准确的个人资料或机构资料，如个人资料或机构资料有任何变动，必须及时更新。', 'Users must provide accurate and truthful personal or organizational information to Licai Network when applying to use the network services provided by Licai Network, and must promptly update any changes to personal or organizational information.', 'section_4_p2', 41, '0,1968', '2020-08-10 09:39:50', '2020-08-06 10:47:56', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (1723, '用户注册成功后，理才网将给予每个用户一个/多个用户帐号及相应的密码，该用户帐号和密码由用户负责保管；用户可随时改变自己的密码。用户应当对以其用户帐号进行的所有活动和事件承担法律责任，用户若发现任何非法使用本人用户帐号或安全漏洞的情况，立即通告理才网。', 'Do you update the bank card in the payroll file according to the bank card information in [Displayed in the list] in the organization and personnel - employee file? This will add bank card information for employees who have payroll rules in their payroll file but do not have a bank card set up. This operation does not modify the payroll file for which you have set up a bank card. Once the user has registered, each user will be given one or more user accounts and a corresponding password. You are legally responsible for all activities and events that occur under your account. If you discover any illegal use of your account or any security breach, you shall immediately notify Licai Network Case.', 'section_4_p3', 41, '0,1968', '2020-08-10 09:40:07', '2020-08-06 10:48:34', 'userAgreement', '0', NULL, NULL);
