INSERT INTO `language_fields` VALUES (2101, '全景求是FACT是亚太区知名、中国区权威的职场诚信管理机构，创始团队是中国本土最早的背景调查行业开拓奠基者，结合全球领先的专业方法和理念，已经优化出最适合中国本土的服务模式、优质渠道、高效流程。', 'FACT is a well-known workplace integrity management organization in Asia Pacific and authoritative in China .The founding team is the earliest pioneer in China\'s local background investigation industry, combined with the world\'s leading professional methods and concepts, has optimized the most suitable for China\'s local service model, quality channels, efficient processes.', 'panoramicView', 35, '0,1227', '2020-08-07 14:23:08', '2020-08-07 11:22:19', 'text', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2102, 'FACT的服务范围已经覆盖中国领土的全部地区，以及187个以上的海外国家全模块服务，服务设计的领域涵盖全部主流行业及数百个细分行业，服务水平已经获得千余家知名企业的绝对信任和一致好评。', 'FACT\'s service scope has covered the whole territory of China and more than 187 overseas countries with full module services, covering all mainstream industries and hundreds of sub-segmented industries, and the service level has won the absolute trust and praise of more than a thousand famous enterprises.', 'FACTServiceRange', 35, '0,1227', '2020-08-07 14:13:28', '2020-08-07 11:23:01', 'text', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2103, '应《中华人民共和国网络安全法》要求，使用公开链接分享或短信服务的企业，名称信息需要企业实名信息。请先进行企业认证', 'In response to the requirements of the Cybersecurity Law of the People\'s Republic of China, name information is required for companies that use public link sharing or SMS services. Please do enterprise authentication first.', 'SecurityLawRequire', 35, '0,1227', '2020-08-07 14:10:39', '2020-08-07 11:23:47', 'text', '0', NULL, NULL);
