INSERT INTO `language_fields` VALUES (2191, '散布谣言，扰乱社会秩序，破坏社会稳定的。', 'Spreading rumours, disturbing the social order and undermining social stability.', 'section_4_p10', 41, '0,1968', '2020-08-13 20:34:59', '2020-08-07 14:09:31', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2192, '散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的。', 'Dissemination of obscenity, pornography, gambling, violence, murder, terrorism or incitement to commit a crime.', 'section_4_p11', 41, '0,1968', '2020-08-13 20:34:58', '2020-08-07 14:09:31', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2193, '侮辱或者诽谤他人，侵害他人合法权益的。', 'Insulting or slandering others, infringing on their legitimate rights and interests.', 'section_4_p12', 41, '0,1968', '2020-08-13 20:34:56', '2020-08-07 14:09:31', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2194, '含有法律、行政法规禁止的其他内容的。', 'Contains other contents prohibited by laws and administrative regulations.', 'section_4_p13', 41, '0,1968', '2020-08-13 20:34:54', '2020-08-07 14:09:31', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2195, '用户在使用理才网网络服务过程中，必须遵循以下原则。', 'The following principles must be followed by the user when using the services of the Licai Network.', 'section_4_p14', 41, '0,1968', '2020-08-13 20:34:53', '2020-08-07 14:09:31', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2196, '遵守中国有关的法律和法规。', 'Comply with the relevant laws and regulations of China', 'section_4_p15', 41, '0,1968', '2020-08-13 20:34:50', '2020-08-07 14:09:31', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2197, '不得为任何非法目的而使用网络服务系统。', 'Not to use the web service system for any illegal purpose.', 'section_4_p16', 41, '0,1968', '2020-08-13 20:34:48', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2198, '遵守所有与网络服务有关的网络协议、规定和程序。', 'Adherence to all network protocols, rules and procedures related to network services', 'section_4_p17', 41, '0,1968', '2020-08-13 20:34:47', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2199, '不得利用理才网网络服务系统进行任何可能对互联网的正常运转造成不利影响的行为。', 'You may not use the Licai Network Service System for any act that may adversely affect the normal operation of the Internet.', 'section_4_p18', 41, '0,1968', '2020-08-13 20:34:45', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2200, '不得利用理才网网络服务系统传输任何骚扰性的、中伤他人的、辱骂性的、恐吓性的、庸俗淫秽的或其他任何非法的信息资料。', 'You may not use the Licai Service System to transmit any information that is harassing, libelous, abusive, threatening, vulgar or obscene, or any other illegal material.', 'section_4_p19', 41, '0,1968', '2020-08-13 20:34:43', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2201, '不得利用理才网网络服务系统进行任何不利于理才网的行为。', 'You may not use the Licai Network service system to do anything detrimental to Licai Network.', 'section_4_p20', 41, '0,1968', '2020-08-13 20:34:41', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2202, '若用户的行为不符合以上提到的服务条款，理才网将作出独立判断立即取消用户服务帐号。', 'If a user\'s behavior does not comply with the above mentioned terms of service, Licai Network will, at its sole discretion, immediately cancel the user\'s service account.', 'section_4_p21', 41, '0,1968', '2020-08-13 20:34:39', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2203, '使用理才网网站服务，用户应加强个人或机构资料的保护意识，并注意用户帐号的密码保护。', 'In order to use the services of the Licai Network website, users should be aware of the protection of their personal or organizational data, and should pay attention to the password protection of their accounts.', 'section_4_p22', 41, '0,1968', '2020-08-13 20:34:38', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2204, '盗取他人用户帐号或利用网络通讯骚扰他人，均属于非法行为。用户不得采用测试、欺骗等任何非法手段，盗取其他用户的帐号和对他人进行骚扰。', 'It is illegal to steal another user\'s account or to harass another person using internet communication. Users may not use any illegal means, such as testing, cheating, etc., to steal other users\' accounts and harass others.', 'section_4_p23', 41, '0,1968', '2020-08-13 20:34:36', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2205, '理才网保留独立判定用户的行为是否符合理才网服务条款的要求和精神的权利，如果用户违背了服务条款的规定，理才网有权自行中断或删除其帐号。如用户对理才网中断或删除行为有异议的，应自中断或删除行为作出后三个工作日内向理才网书面提出。', 'We reserve the right to independently determine whether the user\'s behavior complies with the requirements and spirit of the terms of service. If you have objections to the interruption or deletion of your account, you should submit a written objection to Licai Network within three working days after the interruption or deletion of your account.', 'section_4_p24', 41, '0,1968', '2020-08-13 20:34:32', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2206, '理才网不对用户所发布信息的删除或储存失败承担责任。', 'Licai Newtwork is not responsible for the deletion or failure to store information posted by users.', 'section_4_p25', 41, '0,1968', '2020-08-13 20:34:30', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2207, '所有发给用户的通告都可通过电子邮件或常规的信件传送。理才网会通过邮件服务发报消息给用户，告知服务条款的修改、服务变更、或其它重要事项。同时，理才网保留对理才网用户投放商业性广告的权利。', 'All notices to users may be sent by e-mail or regular mail. Licai   Network may send a message to users via the e-mail service informing them of changes in the terms of service, changes in service, or other important matters. We also reserve the right to place commercial advertisements on our users.', 'section_4_p26', 41, '0,1968', '2020-08-13 20:34:28', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2208, '五、服务条款的修改与公示', 'Fifth：modification and publicity of terms of service', 'section_5_title', 41, '0,1968', '2020-08-10 11:56:15', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2209, '理才网会在必要时修改服务条款，一旦本协议的内容发生变动，理才网将会直接在网站上公布修改之后的协议内容，该公布行为视为理才网已经通知用户修改内容。', 'Licai Network will alter service policy，once the contents of this agreement have been changed, we will directly post the modified agreement on our website，which will be deemed to mean that Licai Network has notified the user of the modified contents.', 'section_5_p1', 41, '0,1968', '2020-08-13 20:34:27', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2210, '理才网也可通过其他适当方式向用户提示修改内容。如果不同意理才网对本协议相关条款所做的修改，用户有权停止使用网络服务，如果用户继续使用网络服务，则视为用户接受理才网对本协议相关条款所做的修改。', 'Licai Network may also notify the user of any modifications by other appropriate means. If the user does not agree with any modification to the terms and conditions of this agreement, the user has the right to stop using the network services, and if the user continues to use the network services, the user shall be deemed to have accepted the modification.', 'section_5_p2', 41, '0,1968', '2020-08-13 20:34:12', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2211, '若有任何服务条款与法律相抵触，那这些条款将按尽可能接近的方法重新解析，而其它条款则继续对用户产生法律效力和影响。', 'If any of these terms of service are inconsistent with the law, these terms will be reinterpreted as nearly as possible, while the other terms will continue to have legal force and effect on the user.', 'section_5_p3', 41, '0,1968', '2020-08-13 20:34:10', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2212, '六、服务修订', 'Sixth：service revisions', 'section_6_title', 41, '0,1968', '2020-08-10 11:53:43', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2213, '理才网特别提示用户，理才网为了保障系统升级，有权修改或中断服务，理才网通过网站公告或者邮件方式通知用户修改或者中断服务的时间段，在中断服务期间，用户将无法网上操作，请用户注意查收邮件信息。', 'We would like to remind you that in order to protect the system upgrade, we reserve the right to modify or suspend the services.You will be notified of any changes or interruptions to the service via email or website bulletin.During the service interruption, users will not be able to operate online, so please pay attention to check your email messages.', 'section_6_p1', 41, '0,1968', '2020-08-13 20:34:08', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2214, '七、用户的权利及义务', 'Seventh：rights and obligations of users', 'section_7_title', 41, '0,1968', '2020-08-10 11:53:16', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2215, '用户应向理才网提供其用过的人事信息，包括但不限于工商营业执照、现有人员配置信息及其他资料。', 'Subscriber shall provide Personnel Information, including, but not limited to, business licenses, current staffing information, and other information used by the subscriber to provide to Licai Network.', 'section_7_p1', 41, '0,1968', '2020-08-13 20:34:06', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2216, '用户应积极配合理才网提供相应资料，用户可根据自身的需要和特点，选择适合的方案，例如可以选择适用理才网提供的在线云服务。', 'The user should actively cooperate with the information provided by Licai Network, and the user can choose a suitable solution according to their own needs and characteristics.Choose the right option, e.g. you can choose to use the online cloud services offered by Licai Network.', 'section_7_p2', 41, '0,1968', '2020-08-13 20:34:03', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2217, '为了保证合作的有效性和持续性，用户有义务对其在理才网网站的模块专区进行信息资料的更新，频率不得低于1次/月。理才网帐号的有效期为12个月。如果一个帐号连续12个月不曾使用，即没有以Web方式登录，届时其原有信息将全部删除，理才网不承担责任。', 'In order to ensure the effectiveness and continuity of the cooperation, the user is obliged to update his information in the module area of the Licai Network no less frequently than once a month. The validity of an account on the daydao website is 12 months. If an account is not used for a period of 12 months, that is, if the user has not logged in via the web, all of the user\'s information will be deleted from the account, and we cannot be held responsible for this.', 'section_7_p3', 41, '0,1968', '2020-08-13 20:34:01', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2218, '在合作期内，用户保证其提供给理才网的内容(包括嵌套的信息内容)等资料真实、合法，且不侵犯第三方的合法权益。用户应对该内容享有相应的知识产权或合法使用权，该等权利证明文件应同时提交理才网。', 'During the cooperation period, the user warrants that the content (including nested information content) and other information provided by the user to Licai Network is true and legal, and does not infringe the legal rights and interests of third parties. The user shall enjoy the corresponding intellectual property rights or legal right to use the content, and the documents proving such rights shall be submitted to Licai Network at the same time.', 'section_7_p4', 41, '0,1968', '2020-08-13 20:33:59', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2219, '用户对理才网负有保密义务，不得以任何方式向其他第三方披露透露在履行本协议过程中知悉的理才网任何信息。', 'The user is under a confidentiality obligation to Licai Network and shall not disclose to any third party any information that the user becomes aware of in the course of performing this agreement.', 'section_7_p5', 41, '0,1968', '2020-08-13 20:33:57', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2220, '用户应在本协议约定的范围内使用理才网的名称及标识。如确需在理才网之外使用理才网名称和标识的，应取得理才网的书面授权。用户应保证妥善使用理才网的名称和标识，不得随意修改、剪裁、变更或不恰当引用。', 'The user shall use the names and logos of Licai Network within the scope of this agreement. If it is necessary to use the names and logos outside of the scope of this agreement, the User shall obtain written authorization from Licai Network . The User shall ensure that the name and logo are used properly and shall not be modified, cropped, altered or improperly referenced.', 'section_7_p6', 41, '0,1968', '2020-08-13 20:33:54', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2221, '经理才网书面许可，用户可在其发布的信息中加入宣传资料或广告策划，在理才网提供的各项免费服务中展示其产品。用户应保证其发布内容的真实性与合法性。理才网对上述内容不作实质性审查，用户与第三方因此发生纠纷的，应自行承担全部责任，由此给理才网造成损失的，用户应予赔偿。', 'With the written permission of the Licai Network, the user may include promotional materials or advertising plans in the information published by the manager and may display its products in the free services provided by the manager. The user shall guarantee the authenticity and legality of the content that he/she publishes. If any dispute arises between you and a third party as a result of such content, you shall assume full responsibility for such content, and you shall compensate for any damage caused by such content to Licai Network.', 'section_7_p7', 41, '0,1968', '2020-08-13 20:33:52', '2020-08-07 14:09:32', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2222, '八、违约条款', 'Eighth：breach of contract', 'section_8_title', 41, '0,1968', '2020-08-10 11:52:37', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2223, '本协议的订立、执行和解释及争议的解决均应适用中华人民共和国法律。', 'The laws of the People\'s Republic of China shall apply to the conclusion, execution and interpretation of this Agreement and the settlement of disputes.', 'section_8_p1', 41, '0,1968', '2020-08-13 20:33:50', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2224, '本协议自您登录使用daydao及daydao旗下系列产品起生效，长期有效。', 'This agreement is effective from the time you log in to use daydao and its products, and is long term.', 'section_8_p2', 41, '0,1968', '2020-08-13 20:33:48', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2225, '理才网保留在法律允许范围内对本协议的最终解释权。', 'Licai Network reserves the right of final interpretation of this agreement to the extent permitted by law.', 'section_8_p3', 41, '0,1968', '2020-08-13 20:33:46', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2226, '九、结束服务', 'Ninth：Termination of service', 'section_9_title', 41, '0,1968', '2020-08-10 11:50:44', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2227, '用户若反对任何服务条款的建议或对后来的条款修改有异议，或对理才网服务不满，用户享有以下的权利。', 'If you object to any proposed or subsequent changes to these terms of service, or if you are dissatisfied with the service, you have the following rights：', 'section_9_p1', 41, '0,1968', '2020-08-13 20:33:43', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2228, '不再使用理才网的服务。', 'No longer using Licai Network\'s services', 'section_9_p2', 41, '0,1968', '2020-08-13 20:33:41', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2229, '结束用户使用理才网服务的资格。', 'Terminate the user\'s eligibility to use the services of Rely Talent.', 'section_9_p3', 41, '0,1968', '2020-08-13 20:33:39', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2230, '书面通告理才网公司停止该用户的服务。', 'Written notice to Licai Network to suspend the user\'s service.', 'section_9_p4', 41, '0,1968', '2020-08-13 20:33:37', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2231, '十、知识产权', 'Tenth：intellectual property right', 'section_10_title', 41, '0,1968', '2020-08-10 11:50:13', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2232, '用户保证和声明对其所提供的作品拥有完整的合法的著作权或完整的合法的授权可以用于其在理才网上从事的活动，保证理才网使用该作品不违反国家的法律法规，也不侵犯第三方的合法权益或承担任何义务。用户应对其所提供作品因形式、内容及授权的不完善、不合法所造成的一切后果承担完全责任。理才网保留对理才网网站所有内容进行实时监控的权利，并有权依其独立判断对任何违反本协议约定的作品实施删除，理才网对于删除用户作品引起的任何后果或导致用户的任何损失不负任何责任。因用户作品的违法或侵害第三人的合法权益而导致理才网公司或其关联公司对第三方承担任何性质的赔偿、补偿或罚款而遭受损失(直接的、间接的、偶然的、惩罚性的和继发的损失)，用户对于理才网公司及其关联公司或理才网蒙受的上述损失承担全面的赔偿责任。', 'The user warrants and declares that he/she has the complete and legal copyright of the works provided by him/her or that he/she has the complete and legal authorization to use such works for his/her activities on Licai Network Online, and that the use of such works on Licai Network Online does not violate the laws and regulations of the country, nor does it infringe the legal rights and obligations of third parties. The user shall be fully responsible for all consequences arising from the imperfection or illegality of the form, content and authorization of the work provided by the user. You reserve the right to monitor all of the content on the daydao website in real time and to delete any work that violates this Agreement at Licai Network\'s sole discretion, and Licai Network shall not be liable for any consequences or losses incurred by you as a result of the deletion of your work. The User assumes full liability for any damages (direct, indirect, incidental, punitive, and consequential damages) suffered by any third party as a result of the violation of the law or infringement of a third party\'s legal rights by the User\'s work, and the User assumes full liability for any such damages suffered by the Company or its affiliates or by the Company.', 'section_10_p1', 41, '0,1968', '2020-08-13 20:33:32', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2233, '十一、争议解决', 'Eleventh：Dispute settlement', 'section_11_title', 41, '0,1968', '2020-08-10 11:49:02', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2234, '如双方就本协议内容或其执行发生任何争议，双方应尽量友好协商解决。协商不成时，任何一方均可向理才网公司所在地的深圳市南山区人民法院提起诉讼。', 'If any dispute arises between the parties concerning the content of this agreement or its implementation, the parties shall try to resolve it amicably. In the event of any failure to do so, either party may file a lawsuit with the People\'s Court of Nanshan District, Shenzhen, where Licai Network is located.', 'section_11_p1', 41, '0,1968', '2020-08-13 20:33:29', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2235, '十二、其它', 'Twelfth：the other', 'section_12_title', 41, '0,1968', '2020-08-10 11:46:27', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2236, '理才网将视向用户所提供服务内容之特性，要求用户在注册理才网提供的有关服务时，遵守特定的条件和条款；如该特定条件和条款与以上服务条款有任何不一致之处，则以特定条件和条款为准。', 'Depending on the nature of the services provided to users, you will be required to comply with certain terms and conditions when you register for any of the services provided by Licai Network .In case of any inconsistency between the specific terms and conditions and the above terms of service, the specific conditions and terms shall prevail', 'section_12_p1', 41, '0,1968', '2020-08-13 20:33:27', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2237, '本服务条款中的某一条款无论因何种原因被认定为无效或不具有执行力，不影响其余条款仍应有效并且有约束力。', 'The fact that a provision of these terms of service is held invalid or unenforceable for any reason shall not affect the validity and binding nature of the remaining provisions.', 'section_12_p2', 41, '0,1968', '2020-08-13 20:33:24', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2238, '本服务条款执行过程中所产生的任何问题，理才网和用户都将友好协商解决。', 'Any problems arising from the implementation of these terms of service will be resolved amicably between Licai Network and the user.', 'section_12_p3', 41, '0,1968', '2020-08-13 20:33:22', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2239, '以上条款的解释权归理才网最终所有。', 'The right of interpretation of the above clauses belongs to Licai Network', 'section_12_p4', 41, '0,1968', '2020-08-13 20:33:19', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2240, 'daydao产品使用客户资料保密承诺', 'Privacy Policy for the use of daydao products', 'section_13_title', 41, '0,1968', '2020-08-10 11:24:01', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2241, '为更好的满足用户的需求，服务于用户，理才网公司向用户提供在线人力资源管理、财务管理、销售管理、协同办公等水平云产品应用及信息、交通、建设、餐饮、医疗等垂直云产品应用，以上的产品应用统称为“daydao产品”。', 'In order to better meet the needs of users and serve them, Licai Network provides users with horizontal cloud product applications such as online human resources management, financial management, sales management, collaborative office, and vertical cloud product applications such as information, transportation, construction, catering, medical, etc. The above product applications are collectively referred to as \"daydao products\".', 'section_13_p1', 41, '0,1968', '2020-08-13 20:33:01', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2242, '针对用户资料信息安全，理才网公司做出如下保密承诺。', 'In regard to the security of user data, Licai Network makes the following promises of confidentiality：', 'section_13_p2', 41, '0,1968', '2020-08-13 20:32:58', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2243, '承诺保密范围。', 'Scope of the confidentiality undertaking', 'section_13_p3', 41, '0,1968', '2020-08-13 20:32:54', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2244, 'daydao产品注册使用的所涉及到得所有客户输入到系统中的员工档案资料、客户信息。包括：员工档案、员工数据等属于客户保密的资料。', 'daydao product registration involves all the customer input into the system of the employee files, customer information. Including: staff files, staff data and other confidential information belonging to the customer.', 'section_13_p4', 41, '0,1968', '2020-08-13 20:32:52', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2245, '保密责任。', 'Duty of confidentiality', 'section_13_p5', 41, '0,1968', '2020-08-13 20:32:47', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2246, '未经用户许可，理才网应做到以下保密责任。', 'Without the user\'s permission, Licai Network shall have the following confidentiality responsibilities:', 'section_13_p6', 41, '0,1968', '2020-08-13 20:32:45', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2247, '理才网必须采取有效的安全措施和操作规程防止用户的保密信息不被泄露。', 'We must take effective security measures and operating procedures to prevent the disclosure of confidential information of our users.', 'section_13_p7', 41, '0,1968', '2020-08-13 20:32:42', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2248, '理才网不可将秘密泄露给第三方，只允许将信息透露给理才网公司或者用户的管理级人员、签约者。', 'It is not permitted to disclose secrets to third parties, but only to administrative personnel or contractors of our company or our users.', 'section_13_p8', 41, '0,1968', '2020-08-13 20:32:40', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2249, '理才网采取尽可能的措施对所有来自用户的信息严格保密，直到服务结束后，消息公开。', 'Licai Network takes every possible measure to keep all information from users strictly confidential until the end of the service, when the information is made public.', 'section_13_p9', 41, '0,1968', '2020-08-13 20:32:37', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2250, '使用限制承诺。', 'Commitment to use restrictions', 'section_13_p10', 41, '0,1968', '2020-08-13 20:32:35', '2020-08-07 14:09:33', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2251, '非用户许可理才网不得透露涉及商业使用权、专利权、复制权、商标、技术机密、商业机密或其他归用户专有的权利。', 'Licai Network not disclose any commercial use rights, patent rights, reproduction rights, trademarks, trade secrets, technical secrets, trade secrets or other rights that are proprietary to users without  permission.', 'section_13_p11', 41, '0,1968', '2020-08-13 20:32:32', '2020-08-07 14:09:34', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2252, '非用户许可，理才网不得擅自将合作的事宜和保密内容，用作商业宣传或者为商业目的而透露给用户的商业竞争伙伴或其他威胁到用户利益的单位或个人。', 'Without the user\'s permission, Licai Network shall not use the cooperation matters and confidential content for commercial publicity or disclose them to the user\'s business partners or other entities or individuals who threaten the user\'s interests for commercial purposes.', 'section_13_p12', 41, '0,1968', '2020-08-13 20:32:30', '2020-08-07 14:09:34', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2253, '其他。', 'Other', 'section_13_p13', 41, '0,1968', '2020-08-13 20:32:28', '2020-08-07 14:09:34', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2254, '保密承诺自客户注册使用理才网的daydao产品时生效，生效前提为不违反中华人民共共和国的法律法规，不危害社会安全，不损害国家利益。在下列情形下，理才网公司不承担保密责任。', 'The promise of confidentiality comes into effect when the customer registers to use the daydao products of Licai Network, provided that it does not violate the laws and regulations of the People\'s Republic of China, does not endanger social security, and does not harm national interests. Under the following circumstances, the company shall not be responsible for confidentiality.', 'section_13_p14', 41, '0,1968', '2020-08-13 20:32:24', '2020-08-07 14:09:34', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2255, '在用户注册使用或者公布前，信息已经被他人知晓或已公开，或者非理才网的错误行为导致的信息已公开。', 'The information is already known or publicly available before the user registers for use or publication, or the information has been made public through no fault of Licai Network.', 'section_13_p15', 41, '0,1968', '2020-08-13 20:32:21', '2020-08-07 14:09:34', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2256, '用户没有对理才网发布限制要求的情况下，公布的信息。', 'Publication of information where the user has not requested a restriction on the distribution of the information .', 'section_13_p16', 41, '0,1968', '2020-08-13 20:32:16', '2020-08-07 14:09:34', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2257, '原则上服务结束后，保密协议自动失效。如果理才网所知悉的保密信息，仍然为少数人所知悉的保密信息，且用户不公开对外宣布，用户有继续要求理才网保密的权利，且保密时限可另外商定。', 'In principle, the confidentiality agreement will automatically expire after the services are completed. If the confidential information known to Licai Network is still confidential information known to a few people, and the user does not announce it publicly, the user has the right to continue to request Licai Network to keep it confidential, and the confidentiality period can be agreed upon separately.', 'section_13_p17', 41, '0,1968', '2020-08-13 20:32:13', '2020-08-07 14:09:34', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2258, '承诺责任承担。', 'Commitment to responsibility', 'section_13_p18', 41, '0,1968', '2020-08-13 20:32:09', '2020-08-07 14:09:34', 'userAgreement', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (2259, '因理才网违反本保密承诺造成用户经济损失的，理才网公司自愿承担损失赔偿责任。', 'If the user suffers any economic loss due to the violation of this confidentiality commitment, Licai Network shall voluntarily bear the liability for the loss.', 'section_13_p19', 41, '0,1968', '2020-08-13 20:31:54', '2020-08-07 14:09:34', 'userAgreement', '0', NULL, NULL);
