INSERT INTO `language_fields` VALUES (3481, '《中华人民共和国合同法》', 'Contract law of the people\'s Republic of China', 'electronic_contract_introduction_content_intro', 35, '0,3353', '2020-08-13 21:04:27', '2020-08-13 20:54:36', 'valueAddedService', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (3482, '签署方式', 'Mode of signature', 'signedWay', 35, '0,1227', '2020-08-13 21:28:12', '2020-08-13 20:55:22', 'text', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (3483, '<p class=\"line mb30\">                     第二章第十一条 书面形式是指合同书、信件和数据电文（包括电报、电传、传真、电子数据交换和电子邮件）等可以有形地表现所载内容的形式。                 </p>                 <h4 class=\"h4 mtb10\">《电子签名法》：</h4>                 <p class=\"line\">第三章第十三条 电子签名同时符合下列条件的，视为可靠的电子签名：</p>                 <p class=\"line\">（一）电子签名制作数据用于电子签名时，属于电子签名人专有；</p>                 <p class=\"line\">（二）签署时电子签名制作数据仅由电子签名人控制；</p>                 <p class=\"line\">（三）签署后对电子签名的任何改动能够被发现；</p>                 <p class=\"line\">（四）签署后对数据电文内容和形式的任何改动能够被发现。</p>                 <p class=\"line\">当事人也可以选择使用符合其约定的可靠条件的电子签名。</p>                 <h4 class=\"h4 mtb10\">第十四条可靠的电子签名与手写签名或者盖章具有同等的法律效力。</h4>', '<p class=\"line mb30\">Chapter II, Article 11 Written form means forms such as contracts, letters and data messages (including telegrams, telexes, faxes, electronic data interchange (EDI) and electronic mail) in which the content contained therein can be physically represented. </p> <h4 class=\"h4 mtb10\">Electronic Signature Law:</h4> <p class=\"line\">Chapter 3, Article 13 An electronic signature is considered reliable if it also meets the following conditions:</p> <p class=\"line\">(1) When electronic signature creation data is used for an electronic signature, it is a (ii) the electronic signature creation data are under the sole control of the electronic signatory at the time of signature;</p> <p class=\"line\">(iii) any changes made to the electronic signature after signature can be detected;</p> <p class=\"line\">(iv) the content of the data message after signature. and any changes to the form can be detected. </p> <p class=\"line\">The parties may also choose to use an electronic signature that meets the conditions of reliability they have agreed upon. </p> <h4 class=\"h4 mtb10\">Article 14 Reliable electronic signatures have the same legal effect as a handwritten signature or seal. </h4>', 'electronic_contract_introduction_content_des', 35, '0,3353', '2020-08-13 21:19:41', '2020-08-13 20:56:32', 'valueAddedService', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (3484, '选择该合同类型需要签署的方式,默认员工签署方式为通过手机进行手写签名', 'Select the method of signing the contract type. The default signing method is handwritten signature by mobile phone', 'handwrittenSignature', 35, '0,1227', '2020-08-13 21:11:51', '2020-08-13 20:56:33', 'text', '0', NULL, NULL);
INSERT INTO `language_fields` VALUES (3485, '发起签署后，员工必须在签署时效内完成签署,否则合同将自动撤回', 'After initiating the signing, the employee must sign within the statute of limitations, or the contract will be automatically withdrawn.', 'automaticWithdrawal', 35, '0,1227', '2020-08-13 21:29:02', '2020-08-13 20:59:09', 'text', '0', NULL, NULL);
